import React from "react";
import axios from "axios";

const logout = async () => {
    try {
        setRole(null);
        const response = await axios.post('/api/user/logout');
        console.log(response.data.message);
        navigate('/user/login');    
      } catch (error) {
        console.error('Logout failed:', error);
      }
}

export default logout;
